// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TaskRegistry {
    struct Task {
        uint256 id;
        string name;
        string slug;
        string efforts;
        uint256 status;
        string dead_line;
        uint256 complete_per;
        string description;
        string add_date;
        string upd_date;
        uint256 company;
        uint256[] assign;
    }

    Task[] public tasks;

    function addTask(
        uint256 _id,
        string memory _name,
        string memory _slug,
        string memory _efforts,
        uint256 _status,
        string memory _dead_line,
        uint256 _complete_per,
        string memory _description,
        string memory _add_date,
        string memory _upd_date,
        uint256 _company,
        uint256[] memory _assign
    ) public {
        tasks.push(Task(_id, _name, _slug, _efforts, _status, _dead_line, _complete_per, _description, _add_date, _upd_date, _company, _assign));
    }

    function getTask(uint256 _index) public view returns (Task memory) {
        require(_index < tasks.length, "Index out of bounds");
        return tasks[_index];
    }

    function getTasksCount() public view returns (uint256) {
        return tasks.length;
    }
}
